import React, { Component } from "react"

async function update(e) {
    e.preventDefault();

}

function ChangeURI(props) {
    if (props.owner == true){
        return(
            <div>
                <input id = "newURI" type="text"></input>
                <a href = "#" onClick={this.update.bind(this)}>update</a>
            </div>
        );
    }
    else {
        return (<></>);
    }

}

export default ChangeURI;
